import React from 'react'

function Profile({response}) {
    if(response !== null){
        const artistname = response.data.data[0].artist.name;
        const artistimage = response.data.data[0].artist.picture;
    }
    
    return (
        <div>
            <img src={artistimage} alt=""/>
        </div>
    )
}

export default Profile
